css:
@-moz-document domain("vozforums.com"){
  body
  {
    background: url("https://i.imgur.com/41qVHFL.png") fixed !important;
    background-size: cover !important;
    margin: auto !important;
  }

  td[width="160"]
    {
      display: none !important;
    }

  .tborder, .panel {
    border: none !important;
    border-collapse: collapse;
    background: none !important;
  }

  .alt1, [class^="alt1Active"], .alt2, .alt2Active, #username_box, #profilepic_cell, .panelsurround {
    background: rgba(255,255,255, 0.9) !important;
  }

  .page
  {
    box-shadow: none !important;
    background: none !important;
  }

  .vbmenu_control, .thead, #profile_tabs, .tcat{
    background: red url(https://i.imgur.com/5t2sf5B.png) fixed center center !important;
    background-size: cover !important;
    color: #FFFFFF !important;
    font: bold 13px verdana, geneva, lucida, 'lucida grande', arial, helvetica, sans-serif !important;
  }
}
